package l1_data

import (
	"testing"
	"github.com/gateway-fm/cdk-erigon-lib/common"
)

// taken from https://sepolia.etherscan.io/tx/0x44b7aacaf535bd947803c88c18e63358c8ddd44fbb24950efbb5abb50f938cef
func Test_DecodeL1BatchData(t *testing.T) {
	testData := ""
	txData := common.FromHex(testData)

	initBatch, transactions, err := DecodeL1BatchData(txData)
	if err != nil {
		t.Fatal(err)
	}
	if initBatch != 1 {
		t.Errorf("expected initial batch to be 1 but found %v", initBatch)
	}
	if len(transactions) != 1 {
		t.Errorf("expected 1 transaction but found %v", len(transactions))
	}
}

// taken from https://sepolia.etherscan.io/tx/0x9f83f2cc7152354220a88e5a3991c0e467b58ee02e7c77c0c931baa48b743f77
func Test_DecodeL1MultiBatchData(t *testing.T) {
	testData := ""

	txData := common.FromHex(testData)

	initBatch, transactions, err := DecodeL1BatchData(txData)
	if err != nil {
		t.Fatal(err)
	}
	if initBatch != 4054 {
		t.Errorf("expected initial batch to be 4054 but found %v", initBatch)
	}
	if len(transactions) != 4 {
		t.Errorf("expected 4 transactions but found %v", len(transactions))
	}
}
